import React, { Component } from "react";
import Button from "react-bootstrap/Button";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Form from "react-bootstrap/Form";

class DragAndDrop extends Component {
  state = {
    detectorType: "",
  };
  nameChanged = (event) => {
    this.setState({ detectorType: event.target.value });
    console.log(detectorType);
  };
  render() {
    return (
      <Form className="m-3 items" style={{ textAlign: "center" }}>
        <Row>
          <Col xs="auto" className="my-1">
            <Form.Label
              className="mr-sm-2"
              htmlFor="inlineFormCustomSelect"
              srOnly
            >
              Preference
            </Form.Label>
            <Form.Control
              as="select"
              className="mr-sm-2"
              id="inlineFormCustomSelect"
              custom
            >
              <option value="0">Choose Algorithem</option>
              <option value="regression">Regression</option>
              <option value="hybrid">Hybrid</option>
            </Form.Control>
          </Col>
          <Col>
            <Form.File
              id="custom-file-translate-scss"
              label="Custom file input"
              custom
            >
              <Form.File.Input isValid />
              <Form.File.Label data-browse="Browse..">
                Upload Learn CSV file
              </Form.File.Label>
              <Form.Control.Feedback type="valid">
                You did it!
              </Form.Control.Feedback>
            </Form.File>
          </Col>
          <Col>
            <Form.File
              id="custom-file-translate-scss"
              label="Custom file input"
              custom
            >
              <Form.File.Input isValid />
              <Form.File.Label placeholder="dad" data-browse="Browse..">
                Upload Anomaly CSV file
              </Form.File.Label>
              <Form.Control.Feedback type="valid">
                You did it!
              </Form.Control.Feedback>
            </Form.File>
          </Col>
          <Col>
            <Button type="submit">Submit</Button>
          </Col>
        </Row>
        <Row>
          <input type="text" onChange={this.nameChanged} />
        </Row>
      </Form>
    );
  }
  formatCount() {
    const { count } = this.state;
    return count === 0 ? "Zero" : count;
  }
}

export default DragAndDrop;
